int Min(int a, int b)
{
	if (a < b) {
		return a;
	} else {
		return b;
	}
}

int Max(int a, int b)
{
	if (a > b) {
		return a;
	} else {
		return b;
	}
}

void PelletRoute(int warehouse[10][10])
{
	int i, j;
	int srow, scol;
	int erow, ecol;
	int startIndex, endIndex;

	// Locate positions
	srow = 0; scol = 0; erow = 0; ecol = 0;
	for (i = 0; i < 10; i++) {
		for (j = 0; j < 10; j++) {
			if (warehouse[i][j] == 1) {
				srow = i;
				scol = j;
			} else if (warehouse[i][j] == 2) {
				erow = i;
				ecol = j;
			}
		}
	}

	// Draw horizontal lines
	startIndex = Min(scol, ecol);
	endIndex = Max(scol, ecol);
	for (i = startIndex; i <= endIndex; i++) {
		if (warehouse[srow][i] == 0) {
			warehouse[srow][i] = 3;
		}
	}

	// Draw vertical lines
	startIndex = Min(srow, erow);
	endIndex = Max(srow, erow);
	for (i = startIndex; i <= endIndex; i++) {
		if (warehouse[i][ecol] == 0) {
			warehouse[i][ecol] = 3;
		}
	}
}
